-- Criação Tabelas
DROP TABLE IF EXISTS Saidas, Entradas, Estoque, Fornecedores, Produtos;
CREATE TABLE Produtos (ProdutoID INT PRIMARY KEY, Nome VARCHAR(100), Categoria VARCHAR(50), Unidade VARCHAR(10), EstoqueMinimo INT, ValorUnitario DECIMAL(10,2));
CREATE TABLE Fornecedores (FornecedorID INT PRIMARY KEY, NomeFornecedor VARCHAR(100), Categoria VARCHAR(50), PrazoEntrega INT, Cidade VARCHAR(50));
CREATE TABLE Estoque (ProdutoID INT PRIMARY KEY, EstoqueAtual INT, DataAtualizacao DATE);
CREATE TABLE Entradas (EntradaID INT PRIMARY KEY, ProdutoID INT, Quantidade INT, DataEntrada DATE, FornecedorID INT);
CREATE TABLE Saidas (SaidaID INT PRIMARY KEY, ProdutoID INT, Quantidade INT, DataSaida DATE, Destino VARCHAR(100));

